import React from "react";
import "../TabMenu/tab.css";
import Menu from "./menu";

const GalleryReact = () => {
  return (
    <>
      <h1> Order Your Favourite Dish</h1>
      <hr />

      <div className="mt-5 text-center main-heading"></div>

      <div className="menu-tabs container">
        <div className="menu-tab d-flex justify-content-around">
          <button  type="button" class="btn btn-warning">Breakfast</button>
          <button  type="button" class="btn btn-warning">Lunch</button>
          <button  type="button" class="btn btn-warning">Evening</button>
          <button  type="button" class="btn btn-warning">Dinner</button>
          <button  type="button" class="btn btn-warning">All</button>
        </div>

        <div class="row d-flex justify-content-around">
    <div class="col-4">
      One of two columns
    </div>
    <div class="col-4">
      One of two columns
    </div>
  </div>
      </div>

      {/* <Menu/> */}
    </>
  );
};

export default GalleryReact;
